-- BEGIN TRANSACTION;
CREATE TABLE `microposts` (`id` INTEGER PRIMARY KEY AUTO_INCREMENT NOT NULL, `content` varchar(255), `user_id` integer, `created` datetime NOT NULL, `modified` datetime NOT NULL);
CREATE TABLE `relationships` (`id` INTEGER PRIMARY KEY AUTO_INCREMENT NOT NULL, `follower_id` integer, `followed_id` integer, `created` datetime NOT NULL, `modified` datetime NOT NULL);
CREATE TABLE `schema_migrations` (`version` varchar(255) NOT NULL);
CREATE TABLE `users` (`id` INTEGER PRIMARY KEY AUTO_INCREMENT NOT NULL, `name` varchar(255), `email` varchar(255), `created` datetime NOT NULL, `modified` datetime NOT NULL, `password_digest` varchar(255), `remember_token` varchar(255), `admin` boolean DEFAULT 0);
CREATE INDEX `index_microposts_on_user_id_and_created` ON `microposts` (`user_id`, `created`);
CREATE INDEX `index_relationships_on_followed_id` ON `relationships` (`followed_id`);
CREATE INDEX `index_relationships_on_follower_id` ON `relationships` (`follower_id`);
CREATE UNIQUE INDEX `index_relationships_on_follower_id_and_followed_id` ON `relationships` (`follower_id`, `followed_id`);
-- CREATE UNIQUE INDEX `index_users_on_email` ON `users` (`email`);
CREATE INDEX `index_users_on_remember_token` ON `users` (`remember_token`);
CREATE UNIQUE INDEX `unique_schema_migrations` ON `schema_migrations` (`version`);
-- COMMIT;
